const DrHeader = () => {

    return (
        <div className="DrHeader">
            <div className="info_box">
                <i className="fa-solid fa-plus add_btn"></i>
            </div>
            <div className="info_box">
                <i class="fa-solid fa-user user_btn"></i>
            </div>
        </div>
    );

}

export default DrHeader;
